import React, { useState } from "react";

import {
  Row,
  Col,
  Card,
  CardBody,
  FormGroup,
  Button,
  CardTitle,
  CardSubtitle,
  Label,
  Input,
  InputGroup,
  CardImg,
  CardText,
  CardHeader,
  CardImgOverlay,
  CardFooter,
  CardDeck,
  CardColumns,
  CardGroup,
} from "reactstrap";
import { AvForm, AvField } from "availity-reactstrap-validation";
import { Link } from "react-router-dom";
//import img2 from "../../assets/images/small/img-2.jpg"
//import img2 from '../../src/assets/images/small/img-2.jpg';
import img2 from "../../assets/images/small/img-2.jpg";

const DoctorCard = ({ props }) => {
  // States for Input fields...
  // Will be shared to the backend via axios

  return (
    <React.Fragment>
      <Col mg={6} lg={3}>
        <Card>
          <CardImg top className="img-fluid" src={img2} alt="Card image cap" />
          <CardBody>
            <CardTitle className="h4 mt-0">
              Full Name: {props.firstname} {props.lastname}{" "}
            </CardTitle>

            <CardText>Age: {props.age}</CardText>
            <CardText>Cnic: {props.CNIC}</CardText>

            <CardTitle className="h4 mt-0">Contact: {props.phone} </CardTitle>
           
            

            <CardTitle className="h4 mt-0">Information</CardTitle>

            <ul className="list-group list-group-flush">
              <li className="list-group-item">Age: {props.age}</li>
              <li className="list-group-item"> Cnic: {props.CNIC} </li>
            </ul>

            <CardTitle className="h4 mt-0">Information</CardTitle>
            <ul className="list-group list-group-flush">
              <li className="list-group-item"> </li>
              <li className="list-group-item">  </li>
            </ul>
          </CardBody>

          <CardBody>
            <Link to="#" className="card-link">
              Card link
            </Link>{" "}
            <Link to="#" className="card-link">
              Another link
            </Link>
          </CardBody>
        </Card>
      </Col>
    </React.Fragment>
  );
};

export default DoctorCard;
